    /// <summary>
    /// Creates an instance of the specified type for the given YAML section.
    /// </summary>
    /// <typeparam name="TInterface">The interface type expected by the Configure method.</typeparam>
    /// <param name="sectionName">The YAML section name (e.g., "Regularization").</param>
    /// <param name="typeName">The concrete type name from YAML (e.g., "L2Regularization").</param>
    /// <param name="parameters">Optional parameters to apply to the instance.</param>
    /// <returns>The created and configured instance.</returns>
    internal static TInterface CreateInstance<TInterface>(string sectionName, string typeName, Dictionary<string, object>? parameters = null)
    {
        if (!_sectionRegistries.TryGetValue(sectionName, out var registry))
        {
            throw new ArgumentException($"Unknown YAML section: '{sectionName}'.");
        }

        if (!registry.TryGetValue(typeName, out var concreteType))
        {
            var available = string.Join(", ", registry.Keys);
            throw new ArgumentException($"Unknown type '{typeName}' for section '{sectionName}'. Available types: {available}");
        }

        var instance = CreateWithBestConstructor(concreteType, parameters);
        if (instance is null)
        {
            throw new InvalidOperationException($"Failed to create instance of type '{concreteType.FullName}'.");
        }

        YamlParamsHelper.ApplyParams(instance, parameters);

        if (instance is TInterface typed)
        {
            return typed;
        }

        throw new InvalidCastException($"Type '{concreteType.FullName}' does not implement '{typeof(TInterface).Name}'.");
    }

    /// <summary>
    /// Creates an instance using the best matching constructor. Tries parameterless first,
    /// then falls back to constructors whose parameters can be resolved from YAML params
    /// or created with default values.
    /// </summary>
    private static object? CreateWithBestConstructor(Type concreteType, Dictionary<string, object>? parameters)
    {
        var constructors = concreteType.GetConstructors(System.Reflection.BindingFlags.Public | System.Reflection.BindingFlags.Instance);

        // Try parameterless constructor first.
        foreach (var ctor in constructors)
        {
            if (ctor.GetParameters().Length == 0)
            {
                return ctor.Invoke(Array.Empty<object>());
            }
        }

        // Sort constructors: fewest parameters first for simplest match.
        var sortedCtors = constructors.OrderBy(c => c.GetParameters().Length).ToArray();

        foreach (var ctor in sortedCtors)
        {
            var ctorParams = ctor.GetParameters();
            var args = new object?[ctorParams.Length];
            var canResolve = true;

            for (int i = 0; i < ctorParams.Length; i++)
            {
                var param = ctorParams[i];
                var paramType = param.ParameterType;

                // Check if YAML params has a matching value by name.
                if (parameters is not null && TryResolveFromParams(parameters, param.Name ?? "", paramType, out var resolved))
                {
                    args[i] = resolved;
                }
                else if (param.HasDefaultValue)
                {
                    args[i] = param.DefaultValue;
                }
                else if (paramType.IsValueType)
                {
                    args[i] = Activator.CreateInstance(paramType);
                }
                else if (IsNullableParam(param))
                {
                    args[i] = null;
                }
                else
                {
                    // Try to create the parameter type (e.g., an Options object).
                    try
                    {
                        var paramInstance = Activator.CreateInstance(paramType);
                        if (paramInstance is not null)
                        {
                            YamlParamsHelper.ApplyParams(paramInstance, parameters);
                            args[i] = paramInstance;
                        }
                        else
                        {
                            canResolve = false;
                            break;
                        }
                    }
                    catch
                    {
                        canResolve = false;
                        break;
                    }
                }
            }

            if (canResolve)
            {
                try
                {
                    return ctor.Invoke(args);
                }
                catch
                {
                    // Try next constructor.
                }
            }
        }

        // Last resort: try Activator with no args (may throw).
        return Activator.CreateInstance(concreteType);
    }

    private static bool TryResolveFromParams(Dictionary<string, object> parameters, string paramName, Type paramType, out object? result)
    {
        result = null;
        foreach (var kvp in parameters)
        {
            if (string.Equals(kvp.Key, paramName, StringComparison.OrdinalIgnoreCase))
            {
                try
                {
                    var underlyingType = Nullable.GetUnderlyingType(paramType) ?? paramType;
                    if (underlyingType.IsEnum && kvp.Value is string enumStr)
                    {
                        result = Enum.Parse(underlyingType, enumStr, ignoreCase: true);
                        return true;
                    }
                    result = Convert.ChangeType(kvp.Value, underlyingType, System.Globalization.CultureInfo.InvariantCulture);
                    return true;
                }
                catch
                {
                    return false;
                }
            }
        }
        return false;
    }

    private static bool IsNullableParam(System.Reflection.ParameterInfo param)
    {
        // Check for nullable reference type or Nullable<T>.
        if (Nullable.GetUnderlyingType(param.ParameterType) is not null) return true;
        var nullableAttr = param.GetCustomAttributes(true)
            .FirstOrDefault(a => a.GetType().FullName == "System.Runtime.CompilerServices.NullableAttribute");
        if (nullableAttr is not null) return true;
        // If the parameter has a nullable annotation in metadata.
        return !param.ParameterType.IsValueType;
    }

